import { useRouter } from 'next/router'
import MainLayout from '@/components/layouts/MainLayout'

const Category = () => {
  const router = useRouter()

  const meta = {
    title: 'a',
    keywords: [
      'a'
    ],
    description: 'a'
  }

  return (
    <>
      <MainLayout meta={meta}>
        
      </MainLayout>
    </>
  )
}

export default Category
